import React from "react";
import "./App.css";
import mondaySdk from "monday-sdk-js";
const monday = mondaySdk();

class App extends React.Component {
    constructor(props) {
        super(props);

        // Default state
        this.state = {
            settings: {},
            name: "",
        };
    }

    componentDidMount() {
        const callback = (res) => console.log(res);

        monday.listen("events", callback, { type: "new_items" });
    }

    render() {
        return <div className="App">Hello, mknknnkonday Apps!</div>;
    }
}

export default App;
